import React from 'react';
import { Box, Typography, Button } from '@mui/material';
import Image from '../../assets/images/openflowmachine.png'; // Import your image

const OpenFlowMachinePortfolio = () => {
  return (
    <Box sx={{ flexGrow: 1, bgcolor: 'background.default', color: 'text.primary', p: 3 }}>
      <Typography variant="h4" gutterBottom>
        Bringing the Open Flow Water Channel Machine to the Digital Realm
      </Typography>
      <Typography variant="subtitle1" gutterBottom>
        Anthony Mercadante - Full Stack Software Developer
      </Typography>
      <Typography variant="body1" gutterBottom>
        As my 8-month co-op comes to an end, I'm thrilled to share the first of many projects...
        {/* Continue with your content */}
      </Typography>

      {/* Image placeholder */}
      <img src={Image} alt="Close-up shot of the machine" style={{ maxWidth: '100%', height: 'auto' }} />

      {/* YouTube Video Embed */}
      <Box sx={{ my: 4, width: '100%', maxWidth: 560, height: 'auto' }}>
        <iframe 
          width="100%" 
          height="315" 
          src="https://www.youtube.com/embed/Hc-zFQL8nQQ" 
          title="YouTube video player" 
          frameBorder="0" 
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" 
          allowFullScreen
        ></iframe>
      </Box>

      {/* More content */}
      <Typography variant="body1" gutterBottom>
        Understanding the Fluid Dynamics: Before diving into the development...
        {/* Continue with your content */}
      </Typography>

      {/* Additional sections for Interactive Learning, Hands-on Experiments, etc. */}
      {/* ... */}

      <Box sx={{ mt: 4 }}>
        <Button variant="contained" color="primary">
          Learn More
        </Button>
      </Box>
    </Box>
  );
};

export default OpenFlowMachinePortfolio;
